import React, { Fragment, useState } from "react";

const Question = () => {
  return (
    <Fragment>
      <form>
        <label>Type your budget: </label>
        <input
          type="number"
          name="budget"
          placeholder="Which is your budget?"
        ></input>
        <button type="submit">Start</button>;
      </form>
    </Fragment>
  );
};

export default Question;
